insert  into `wiz_mailsms`(`code`,`subject`,`sms_cust`,`sms_oper`,`sms_msg`,`email_subj`,`email_cust`,`email_oper`,`email_msg`) values ('mem_notice','일반 메일 발송시','N','N','','','N','N','<div style=\"background: rgb(248, 248, 248); padding: 50px 0px; font-size: 0px;\"><div style=\"margin: 0px auto; width: 700px;\">\r\n<div style=\"background: rgb(24, 215, 223); text-align: right; margin-top: 15px;\"><img src=\"http://anywiz.co.kr/admin/mail/img/top-line.gif\" border=\"0\"></div>\r\n\r\n<div style=\"background: rgb(255, 255, 255); padding: 55px 0px 40px; text-align: center;\">\r\n<div><img src=\"http://anywiz.co.kr/admin/mail/img/top-icon.png\"></div>\r\n<div style=\"color: rgb(51, 51, 51); line-height: 30px; letter-spacing: -4px; font-size: 23px; margin-top: 25px;\"><span style=\"font-family: 바탕체,BatangChe,맑은고딕,MalgunGothic;\">알려드립니다.</span></div>\r\n<div style=\"color: rgb(153, 153, 153); line-height: 20px; letter-spacing: -1px; font-size: 13px; margin-top: 5px;\"><span style=\"font-family: 돋움,Dotum;\">회원님들께 알려드리는 메일입니다. 확인 바랍니다.</span></div>\r\n</div>\r\n\r\n<div style=\"background: rgb(255, 255, 255); padding: 30px; color: rgb(51, 51, 51); font-size: 12px; border-top-color: rgb(221, 221, 221); border-bottom-color: rgb(221, 221, 221); border-top-width: 1px; border-bottom-width: 1px; border-top-style: solid; border-bottom-style: solid;\"><span style=\"font-family: 돋움,Dotum;\">메일 내용 작성</span></div>\r\n\r\n<div style=\"background: rgb(255, 255, 255); padding: 20px; text-align: left; color: rgb(153, 153, 153); line-height: 18px; font-size: 12px;\">\r\n<span style=\"font-family: 돋움,Dotum;\">※ 본 메일은 발신 전용으로 회신되지 않습니다.</span><br><span style=\"font-family: 돋움,Dotum;\">\r\n※ 메일을 원하지 않으시면 로그인 후 회원정보 변경에서 이메일 수신 여부를 변경하시기 바랍니다.</span>\r\n\r\n\r\n</div></div></div>'),('mem_apply','[회원관련] 회원가입시','Y','N','[{SHOP_NAME}] - {MEM_NAME}님 가입해주셔서 감사합니다.','[{SHOP_NAME}] - 가입해주셔서 감사합니다.','Y','N','<div style=\"background: rgb(248, 248, 248); padding: 50px 0px; font-size: 0px;\"><div style=\